import { Form } from 'react-bootstrap';


import React, { Component, Fragment } from 'react';
import Select from 'react-select';

import { reduxForm } from 'redux-form';


export class Patientform extends Component {

  onSubmit = formValues => {
    this.props.onSubmit(formValues);
  };
  render() {
    return (
      <div>
        <div className="page-header">
          <h3 className="page-title"> Patient Form </h3>
          <nav aria-label="breadcrumb">
            <ol className="breadcrumb">
              <li className="breadcrumb-item"><a href="!#" onClick={event => event.preventDefault()}>Forms</a></li>
              <li className="breadcrumb-item active" aria-current="page">Form elements</li>
            </ol>
          </nav>
        </div>

       <div className ='row'>
         <div className=" col-md-6 grid-margin stretch-card ">

            <div className="card">
              <div className="card-body">

                <form className="forms-sample" onSubmit={this.onSubmit}>
                  <Form.Group>
                    <label htmlFor="exampleInputUsername1">Project Name</label>
                    <Form.Control type="text" id="exampleInputUsername1" placeholder="project Name" size="lg" />
                  </Form.Group>
                  <Form.Group>
                    <label htmlFor="exampleInputCancerType">Cancer Type</label>

